I am new to typescript and I am trying to write a code that will take user input and then print it. I am using the following code:
var input = prompt("Enter your name");
document.write("Hello " + input);
But it is not working. Can anyone help me with this?
You can use the following code:
var input = prompt("Enter your name");
document.write("Hello " + input);
The problem with your code is that you are using the document.write() method, which is not recommended for writing to the DOM. Instead, you should use the document.getElementById() method to get a reference to the element you want to write to, and then use the innerHTML property to set the content of that element.
Here is an example of how you can use the document.getElementById() method to write to the DOM:
var input = prompt("Enter your name");
var output = document.getElementById("output");
output.innerHTML = "Hello " + input;
In this example, we first get a reference to the element with the id "output" using the document.getElementById() method. Then, we use the innerHTML property to set the content of that element to "Hello " followed by the user input.
